Ext.data.JsonP['Titanium_App_iOS_SearchQuery']({"tagname":"class","name":"Titanium.App.iOS.SearchQuery","extends":"Titanium.Proxy","mixins":[],"alternateClassNames":[],"aliases":{},"singleton":false,"requires":[],"uses":[],"enum":null,"override":null,"inheritable":null,"inheritdoc":null,"meta":{"platform":["iphone 5.5.0","ipad 5.5.0"],"editurl":"https://github.com/appcelerator/titanium_mobile/edit/master/apidoc/Titanium/App/iOS/SearchQuery.yml","description":["<p>You can use this API to search multiple {@link Titanium.App.iOS.SearchableItem} objects at the same time. You can do that \nby using the <code>queryString</code> parameter that has a special syntax to filter and index several items. Please refer \nto the official <a href=\"https://developer.apple.com/reference/corespotlight/cssearchquery\">Apple documentation</a> for detailed information on how to structure your search-query to get the \nbest possible results.</p>\n\n<p>To use this feature make sure you have a compatible device running iOS 10 or later.</p>\n\n<p>To create a SearchableItem object, use the Titanium.App.iOS.createSearchableItem method.\nPass a dictionary of properties to the method that will help identify the item.\nAt minimum, you must set the {@link Titanium.App.iOS.SearchableItem#property-attributeSet attributeSet} property, which associates\nthe metadata with the SearchableItem object.</p> \n<h3>Examples</h3>\n<h4>Perform a simple search-query for all items that start with \"Searchable\" in it.</h4>\n<p>The following example demonstrates how to search a Ti.App.iOS.SearchableItem using the iOS 10\nTi.App.iOS.SearchQuery API.</p>\n\n<h4>app.js</h4>\n\n<pre><code>var win = Ti.UI.createWindow({\n    backgroundColor: \"#fff\"\n});\nvar btn = Ti.UI.createButton({\n    title: \"Start search-query\"\n});\n\nvar searchItems = [];\nvar itemAttr = Ti.App.iOS.createSearchableItemAttributeSet({\n    itemContentType: Ti.App.iOS.UTTYPE_IMAGE,\n    title: \"Titanium Core Spotlight Tutorial\"\n});\n\nitemAttr.contentDescription = \"Tech Example \\nOn: \" + String.formatDate(new Date(), \"short\");\nitemAttr.keywords = [\"Mobile\", \"Appcelerator\", \"Titanium\"];\nitemAttr.displayName = \"Hello world\";\n\nvar item = Ti.App.iOS.createSearchableItem({\n    uniqueIdentifier: \"my-id\",\n    domainIdentifier: \"com.mydomain\",\n    attributeSet: itemAttr\n});\nsearchItems.push(item);\n\nvar indexer = Ti.App.iOS.createSearchableIndex();\n\nindexer.addToDefaultSearchableIndex(searchItems, function(e) {\n    if (e.success) {\n        Ti.API.info(\"Press the home button and now search for your keywords\");\n    } else {\n        alert(\"Searchable index could not be created: \" + JSON.stringify(e.error));\n    }\n});\n\nbtn.addEventListener(\"click\", function() {\n    // An array of found Ti.App.iOS.SearchableItem's\n    var allItems = [];\n\n    // The search-query\n    var searchQuery = Ti.App.iOS.createSearchQuery({\n        queryString: 'title == \"Titanium*\"',\n        attributes: [\"title\", \"displayName\", \"keywords\", \"contentType\"]\n    });\n\n    // The event to be called when a new batch of items is found\n    searchQuery.addEventListener(\"founditems\", function(e) {\n        for (var i = 0; i &lt; e.items.length; i++) {\n            allItems.push(e.items[i]);\n        }\n    });\n\n    // The event to be called when the search-query completes\n    searchQuery.addEventListener(\"completed\", function(e) {\n        if (!e.success) {\n            alert(e.error);\n        }\n\n        for (var i = 0; i &lt; allItems.length; i++) {\n            var attributeSet = allItems[i].attributeSet\n            var foundTitle = attributeSet.title\n            var foundDisplayName = attributeSet.displayName\n\n            Ti.API.info(\"title: \" + foundTitle + \", displayName: \" + foundDisplayName);\n        }\n    });\n\n    // Start the search-query (or use searchQuery.cancel()) to abort it\n    searchQuery.start();\n});\n\nwin.add(btn);\nwin.open();\n</code></pre>"]},"private":null,"id":"class-Titanium.App.iOS.SearchQuery","members":{"cfg":[],"property":[{"name":"apiName","tagname":"property","owner":"Titanium.Proxy","meta":{"readonly":true,"description":["<p>The value of this property is the fully qualified name of the API. For example, {@link Titanium.UI.Button Button}\nreturns <code>Ti.UI.Button</code>.</p>"],"platform":["android 3.2.0","iphone 3.2.0","ipad 3.2.0","windowsphone 4.1.0"]},"id":"property-apiName"},{"name":"attributes","tagname":"property","owner":"Titanium.App.iOS.SearchQuery","meta":{"description":["<p>Each string corresponds to a property name that can be set for an item. For a list of possible properties, see\nthe {@link Titanium.App.iOS.SearchableItemAttributeSet} API. Passing null for this parameter means that the query does not use \nattributes to find matching items.</p>"]},"id":"property-attributes"},{"name":"bubbleParent","tagname":"property","owner":"Titanium.Proxy","meta":{"description":["<p>Some proxies (most commonly views) have a relationship to other proxies, often\nestablished by the add() method. For example, for a button added to a window, a\nclick event on the button would bubble up to the window. Other common parents are\ntable sections to their rows, table views to their sections, and scrollable views\nto their views. Set this property to false to disable the bubbling to the proxy's parent.</p>"],"platform":["android 3.0.0","iphone 3.0.0","ipad 3.0.0","windowsphone 4.1.0"]},"id":"property-bubbleParent"},{"name":"lifecycleContainer","tagname":"property","owner":"Titanium.Proxy","meta":{"description":["<p>If this property is set to a Window or TabGroup, then the corresponding Activity lifecycle event callbacks\nwill also be called on the proxy. Proxies that require the activity lifecycle will need this property set\nto the appropriate containing Window or TabGroup.</p>"],"platform":["android 3.6.0","windowsphone 4.1.0"]},"id":"property-lifecycleContainer"},{"name":"queryString","tagname":"property","owner":"Titanium.App.iOS.SearchQuery","meta":{"creationOnly":[null],"description":["<p>This parameter cannot be null.</p>"]},"id":"property-queryString"}],"method":[{"name":"addEventListener","tagname":"method","owner":"Titanium.Proxy","meta":{},"id":"method-addEventListener"},{"name":"applyProperties","tagname":"method","owner":"Titanium.Proxy","meta":{"description":["<p>Properties are supplied as a dictionary. Each key-value pair in the object is applied to the proxy such that\nmyproxy[key] = value.</p>"],"platform":["android 3.0.0","iphone 3.0.0","ipad 3.0.0","windowsphone 4.1.0"]},"id":"method-applyProperties"},{"name":"cancel","tagname":"method","owner":"Titanium.App.iOS.SearchQuery","meta":{},"id":"method-cancel"},{"name":"fireEvent","tagname":"method","owner":"Titanium.Proxy","meta":{},"id":"method-fireEvent"},{"name":"getApiName","tagname":"method","owner":"Titanium.Proxy","meta":{"platform":["android 3.2.0","iphone 3.2.0","ipad 3.2.0","windowsphone 4.1.0"]},"id":"method-getApiName"},{"name":"getBubbleParent","tagname":"method","owner":"Titanium.Proxy","meta":{"platform":["android 3.0.0","iphone 3.0.0","ipad 3.0.0","windowsphone 4.1.0"]},"id":"method-getBubbleParent"},{"name":"getLifecycleContainer","tagname":"method","owner":"Titanium.Proxy","meta":{"platform":["android 3.6.0","windowsphone 4.1.0"]},"id":"method-getLifecycleContainer"},{"name":"isCancelled","tagname":"method","owner":"Titanium.App.iOS.SearchQuery","meta":{},"id":"method-isCancelled"},{"name":"removeEventListener","tagname":"method","owner":"Titanium.Proxy","meta":{"description":["<p>Multiple listeners can be registered for the same event, so the\n<code>callback</code> parameter is used to determine which listener to remove.</p>\n\n<p>When adding a listener, you must save a reference to the callback function\nin order to remove the listener later:</p>\n\n<pre><code>var listener = function() { Ti.API.info(\"Event listener called.\"); }\nwindow.addEventListener('click', listener);\n</code></pre>\n\n<p>To remove the listener, pass in a reference to the callback function:</p>\n\n<pre><code>window.removeEventListener('click', listener);\n</code></pre>"]},"id":"method-removeEventListener"},{"name":"setBubbleParent","tagname":"method","owner":"Titanium.Proxy","meta":{"platform":["android 3.0.0","iphone 3.0.0","ipad 3.0.0","windowsphone 4.1.0"]},"id":"method-setBubbleParent"},{"name":"setLifecycleContainer","tagname":"method","owner":"Titanium.Proxy","meta":{"platform":["android 3.6.0","windowsphone 4.1.0"]},"id":"method-setLifecycleContainer"},{"name":"start","tagname":"method","owner":"Titanium.App.iOS.SearchQuery","meta":{},"id":"method-start"}],"event":[{"name":"completed","tagname":"event","owner":"Titanium.App.iOS.SearchQuery","meta":{},"id":"event-completed"},{"name":"founditems","tagname":"event","owner":"Titanium.App.iOS.SearchQuery","meta":{},"id":"event-founditems"}],"css_var":[],"css_mixin":[]},"linenr":62374,"files":[{"filename":"titanium.js","href":"titanium.html#Titanium-App-iOS-SearchQuery"}],"html_meta":{"platform":"<ul class='platforms'><li class='platform-iphone'\n        title='iPhone'>5.5.0</li><li class='platform-ipad'\n        title='iPad'>5.5.0</li></ul>","editurl":null,"description":"<p><p>You can use this API to search multiple <a href=\"#!/api/Titanium.App.iOS.SearchableItem\" rel=\"Titanium.App.iOS.SearchableItem\" class=\"docClass\">Titanium.App.iOS.SearchableItem</a> objects at the same time. You can do that \nby using the <code>queryString</code> parameter that has a special syntax to filter and index several items. Please refer \nto the official <a href=\"https://developer.apple.com/reference/corespotlight/cssearchquery\">Apple documentation</a> for detailed information on how to structure your search-query to get the \nbest possible results.</p>\n\n\n\n\n<p>To use this feature make sure you have a compatible device running iOS 10 or later.</p>\n\n\n\n\n<p>To create a SearchableItem object, use the <a href=\"#!/api/Titanium.App.iOS-method-createSearchableItem\" rel=\"Titanium.App.iOS-method-createSearchableItem\" class=\"docClass\">Titanium.App.iOS.createSearchableItem</a> method.\nPass a dictionary of properties to the method that will help identify the item.\nAt minimum, you must set the <a href=\"#!/api/Titanium.App.iOS.SearchableItem-property-attributeSet\" rel=\"Titanium.App.iOS.SearchableItem-property-attributeSet\" class=\"docClass\">attributeSet</a> property, which associates\nthe metadata with the SearchableItem object.</p>\n\n\n<p></p>\n\n<h3>Examples</h3>\n\n\n<h4>Perform a simple search-query for all items that start with \"Searchable\" in it.</h4>\n\n\n<p>The following example demonstrates how to search a Ti.App.iOS.SearchableItem using the iOS 10\nTi.App.iOS.SearchQuery API.</p>\n\n\n\n\n<h4>app.js</h4>\n\n\n\n\n<pre><code>var win = Ti.UI.createWindow({\n    backgroundColor: \"#fff\"\n});\nvar btn = Ti.UI.createButton({\n    title: \"Start search-query\"\n});\n\nvar searchItems = [];\nvar itemAttr = Ti.App.iOS.createSearchableItemAttributeSet({\n    itemContentType: Ti.App.iOS.UTTYPE_IMAGE,\n    title: \"Titanium Core Spotlight Tutorial\"\n});\n\nitemAttr.contentDescription = \"Tech Example \\nOn: \" + String.formatDate(new Date(), \"short\");\nitemAttr.keywords = [\"Mobile\", \"Appcelerator\", \"Titanium\"];\nitemAttr.displayName = \"Hello world\";\n\nvar item = Ti.App.iOS.createSearchableItem({\n    uniqueIdentifier: \"my-id\",\n    domainIdentifier: \"com.mydomain\",\n    attributeSet: itemAttr\n});\nsearchItems.push(item);\n\nvar indexer = Ti.App.iOS.createSearchableIndex();\n\nindexer.addToDefaultSearchableIndex(searchItems, function(e) {\n    if (e.success) {\n        Ti.API.info(\"Press the home button and now search for your keywords\");\n    } else {\n        alert(\"Searchable index could not be created: \" + JSON.stringify(e.error));\n    }\n});\n\nbtn.addEventListener(\"click\", function() {\n    // An array of found Ti.App.iOS.SearchableItem's\n    var allItems = [];\n\n    // The search-query\n    var searchQuery = Ti.App.iOS.createSearchQuery({\n        queryString: 'title == \"Titanium*\"',\n        attributes: [\"title\", \"displayName\", \"keywords\", \"contentType\"]\n    });\n\n    // The event to be called when a new batch of items is found\n    searchQuery.addEventListener(\"founditems\", function(e) {\n        for (var i = 0; i &lt; e.items.length; i++) {\n            allItems.push(e.items[i]);\n        }\n    });\n\n    // The event to be called when the search-query completes\n    searchQuery.addEventListener(\"completed\", function(e) {\n        if (!e.success) {\n            alert(e.error);\n        }\n\n        for (var i = 0; i &lt; allItems.length; i++) {\n            var attributeSet = allItems[i].attributeSet\n            var foundTitle = attributeSet.title\n            var foundDisplayName = attributeSet.displayName\n\n            Ti.API.info(\"title: \" + foundTitle + \", displayName: \" + foundDisplayName);\n        }\n    });\n\n    // Start the search-query (or use searchQuery.cancel()) to abort it\n    searchQuery.start();\n});\n\nwin.add(btn);\nwin.open();\n</code></pre>\n\n</p>"},"statics":{"cfg":[],"property":[],"method":[],"event":[],"css_var":[],"css_mixin":[]},"component":false,"superclasses":["Titanium.Proxy","Titanium.App.iOS.SearchQuery"],"subclasses":[],"mixedInto":[],"parentMixins":[],"html":"<div><div class='sidebar'><ul class=\"sidebar-platforms\"><li class='platform-iphone' title='iPhone since Titanium SDK 5.5.0'>iPhone 5.5.0</li><li class='platform-ipad' title='iPad since Titanium SDK 5.5.0'>iPad 5.5.0</li></ul></div><div class='hierarchy'><div class='classes'><div class='subclass'><a href='#!/api/Titanium.Proxy' rel='Titanium.Proxy' class='docClass'>Titanium.Proxy</a></div><div class='subclass'> &gt; <strong>Titanium.App.iOS.SearchQuery</strong></div></div></div><div class='doc-contents'><p>A search query object manages the criteria to apply when searching app content that you have previously \nindexed by using the Core Spotlight APIs.</p>\n\n\n\n\n<p> <b>Requires:</b> \niOS 10.0 and later \n</p>\n\n<p><p>You can use this API to search multiple <a href=\"#!/api/Titanium.App.iOS.SearchableItem\" rel=\"Titanium.App.iOS.SearchableItem\" class=\"docClass\">Titanium.App.iOS.SearchableItem</a> objects at the same time. You can do that \nby using the <code>queryString</code> parameter that has a special syntax to filter and index several items. Please refer \nto the official <a href=\"https://developer.apple.com/reference/corespotlight/cssearchquery\">Apple documentation</a> for detailed information on how to structure your search-query to get the \nbest possible results.</p>\n\n\n\n\n<p>To use this feature make sure you have a compatible device running iOS 10 or later.</p>\n\n\n\n\n<p>To create a SearchableItem object, use the <a href=\"#!/api/Titanium.App.iOS-method-createSearchableItem\" rel=\"Titanium.App.iOS-method-createSearchableItem\" class=\"docClass\">Titanium.App.iOS.createSearchableItem</a> method.\nPass a dictionary of properties to the method that will help identify the item.\nAt minimum, you must set the <a href=\"#!/api/Titanium.App.iOS.SearchableItem-property-attributeSet\" rel=\"Titanium.App.iOS.SearchableItem-property-attributeSet\" class=\"docClass\">attributeSet</a> property, which associates\nthe metadata with the SearchableItem object.</p>\n\n\n<p></p>\n\n<h3>Examples</h3>\n\n\n<h4>Perform a simple search-query for all items that start with \"Searchable\" in it.</h4>\n\n\n<p>The following example demonstrates how to search a Ti.App.iOS.SearchableItem using the iOS 10\nTi.App.iOS.SearchQuery API.</p>\n\n\n\n\n<h4>app.js</h4>\n\n\n\n\n<pre><code>var win = Ti.UI.createWindow({\n    backgroundColor: \"#fff\"\n});\nvar btn = Ti.UI.createButton({\n    title: \"Start search-query\"\n});\n\nvar searchItems = [];\nvar itemAttr = Ti.App.iOS.createSearchableItemAttributeSet({\n    itemContentType: Ti.App.iOS.UTTYPE_IMAGE,\n    title: \"Titanium Core Spotlight Tutorial\"\n});\n\nitemAttr.contentDescription = \"Tech Example \\nOn: \" + String.formatDate(new Date(), \"short\");\nitemAttr.keywords = [\"Mobile\", \"Appcelerator\", \"Titanium\"];\nitemAttr.displayName = \"Hello world\";\n\nvar item = Ti.App.iOS.createSearchableItem({\n    uniqueIdentifier: \"my-id\",\n    domainIdentifier: \"com.mydomain\",\n    attributeSet: itemAttr\n});\nsearchItems.push(item);\n\nvar indexer = Ti.App.iOS.createSearchableIndex();\n\nindexer.addToDefaultSearchableIndex(searchItems, function(e) {\n    if (e.success) {\n        Ti.API.info(\"Press the home button and now search for your keywords\");\n    } else {\n        alert(\"Searchable index could not be created: \" + JSON.stringify(e.error));\n    }\n});\n\nbtn.addEventListener(\"click\", function() {\n    // An array of found Ti.App.iOS.SearchableItem's\n    var allItems = [];\n\n    // The search-query\n    var searchQuery = Ti.App.iOS.createSearchQuery({\n        queryString: 'title == \"Titanium*\"',\n        attributes: [\"title\", \"displayName\", \"keywords\", \"contentType\"]\n    });\n\n    // The event to be called when a new batch of items is found\n    searchQuery.addEventListener(\"founditems\", function(e) {\n        for (var i = 0; i &lt; e.items.length; i++) {\n            allItems.push(e.items[i]);\n        }\n    });\n\n    // The event to be called when the search-query completes\n    searchQuery.addEventListener(\"completed\", function(e) {\n        if (!e.success) {\n            alert(e.error);\n        }\n\n        for (var i = 0; i &lt; allItems.length; i++) {\n            var attributeSet = allItems[i].attributeSet\n            var foundTitle = attributeSet.title\n            var foundDisplayName = attributeSet.displayName\n\n            Ti.API.info(\"title: \" + foundTitle + \", displayName: \" + foundDisplayName);\n        }\n    });\n\n    // Start the search-query (or use searchQuery.cancel()) to abort it\n    searchQuery.start();\n});\n\nwin.add(btn);\nwin.open();\n</code></pre>\n\n</p><ul class='platforms'><li class='platform-iphone'\n        title='iPhone'>5.5.0</li><li class='platform-ipad'\n        title='iPad'>5.5.0</li></ul></div><div class='members'><div class='members-section'><div class='definedBy'>Defined By</div><h3 class='members-title icon-property'>Properties</h3><div class='subsection'><div id='property-apiName' class='member first-child inherited'><a href='#' class='side expandable'><span>&nbsp;</span></a><div class='title'><div class='meta'><a href='#!/api/Titanium.Proxy' rel='Titanium.Proxy' class='defined-in docClass'>Titanium.Proxy</a></div><a href='#!/api/Titanium.Proxy-property-apiName' class='name not-expandable'>apiName</a><span> : String</span><strong class='readonly signature' >readonly</strong></div><div class='description'><div class='short'><p>The name of the API that this proxy corresponds to.</p>\n\n</div><div class='long'><p>The name of the API that this proxy corresponds to.</p>\n\n<p><p>The value of this property is the fully qualified name of the API. For example, <a href=\"#!/api/Titanium.UI.Button\" rel=\"Titanium.UI.Button\" class=\"docClass\">Button</a>\nreturns <code>Ti.UI.Button</code>.</p>\n\n</p><ul class='platforms'><li class='platform-android'\n        title='Android'>3.2.0</li><li class='platform-iphone'\n        title='iPhone'>3.2.0</li><li class='platform-ipad'\n        title='iPad'>3.2.0</li><li class='platform-windowsphone'\n        title='Window Phone'>4.1.0</li></ul></div></div></div><div id='property-attributes' class='member  not-inherited'><a href='#' class='side expandable'><span>&nbsp;</span></a><div class='title'><div class='meta'><span class='defined-in' rel='Titanium.App.iOS.SearchQuery'>Titanium.App.iOS.SearchQuery</span></div><a href='#!/api/Titanium.App.iOS.SearchQuery-property-attributes' class='name expandable'>attributes</a><span> : String[]</span></div><div class='description'><div class='short'>An array of strings that represent the attributes of indexed items. ...</div><div class='long'><p>An array of strings that represent the attributes of indexed items.</p>\n\n\n\n\n<p> <b>Requires:</b> \niOS 10.0 and later \n</p>\n\n<p><p>Each string corresponds to a property name that can be set for an item. For a list of possible properties, see\nthe <a href=\"#!/api/Titanium.App.iOS.SearchableItemAttributeSet\" rel=\"Titanium.App.iOS.SearchableItemAttributeSet\" class=\"docClass\">Titanium.App.iOS.SearchableItemAttributeSet</a> API. Passing null for this parameter means that the query does not use \nattributes to find matching items.</p>\n\n</p></div></div></div><div id='property-bubbleParent' class='member  inherited'><a href='#' class='side expandable'><span>&nbsp;</span></a><div class='title'><div class='meta'><a href='#!/api/Titanium.Proxy' rel='Titanium.Proxy' class='defined-in docClass'>Titanium.Proxy</a></div><a href='#!/api/Titanium.Proxy-property-bubbleParent' class='name expandable'>bubbleParent</a><span> : Boolean</span></div><div class='description'><div class='short'>Indicates if the proxy will bubble an event to its parent. ...</div><div class='long'><p>Indicates if the proxy will bubble an event to its parent.</p>\n\n<p><p>Some proxies (most commonly views) have a relationship to other proxies, often\nestablished by the add() method. For example, for a button added to a window, a\nclick event on the button would bubble up to the window. Other common parents are\ntable sections to their rows, table views to their sections, and scrollable views\nto their views. Set this property to false to disable the bubbling to the proxy's parent.</p>\n\n</p><p>Default: true</p><ul class='platforms'><li class='platform-android'\n        title='Android'>3.0.0</li><li class='platform-iphone'\n        title='iPhone'>3.0.0</li><li class='platform-ipad'\n        title='iPad'>3.0.0</li><li class='platform-windowsphone'\n        title='Window Phone'>4.1.0</li></ul></div></div></div><div id='property-lifecycleContainer' class='member  inherited'><a href='#' class='side expandable'><span>&nbsp;</span></a><div class='title'><div class='meta'><a href='#!/api/Titanium.Proxy' rel='Titanium.Proxy' class='defined-in docClass'>Titanium.Proxy</a></div><a href='#!/api/Titanium.Proxy-property-lifecycleContainer' class='name not-expandable'>lifecycleContainer</a><span> : <a href=\"#!/api/Titanium.UI.Window\" rel=\"Titanium.UI.Window\" class=\"docClass\">Titanium.UI.Window</a>/<a href=\"#!/api/Titanium.UI.TabGroup\" rel=\"Titanium.UI.TabGroup\" class=\"docClass\">Titanium.UI.TabGroup</a></span></div><div class='description'><div class='short'><p>The Window or TabGroup whose Activity lifecycle should be triggered on the proxy.</p>\n\n</div><div class='long'><p>The Window or TabGroup whose Activity lifecycle should be triggered on the proxy.</p>\n\n<p><p>If this property is set to a Window or TabGroup, then the corresponding Activity lifecycle event callbacks\nwill also be called on the proxy. Proxies that require the activity lifecycle will need this property set\nto the appropriate containing Window or TabGroup.</p>\n\n</p><ul class='platforms'><li class='platform-android'\n        title='Android'>3.6.0</li><li class='platform-windowsphone'\n        title='Window Phone'>4.1.0</li></ul></div></div></div><div id='property-queryString' class='member  not-inherited'><a href='#' class='side expandable'><span>&nbsp;</span></a><div class='title'><div class='meta'><span class='defined-in' rel='Titanium.App.iOS.SearchQuery'>Titanium.App.iOS.SearchQuery</span></div><a href='#!/api/Titanium.App.iOS.SearchQuery-property-queryString' class='name expandable'>queryString</a><span> : String</span><strong class='creationOnly signature' >Creation-Only</strong></div><div class='description'><div class='short'>A formatted string that defines the matching criteria to apply to indexed items. ...</div><div class='long'><p>A formatted string that defines the matching criteria to apply to indexed items.</p>\n\n\n\n\n<p> <b>Requires:</b> \niOS 10.0 and later \n</p>\n\n<p><p>This parameter cannot be null.</p>\n\n</p></div></div></div></div></div><div class='members-section'><div class='definedBy'>Defined By</div><h3 class='members-title icon-method'>Methods</h3><div class='subsection'><div id='method-addEventListener' class='member first-child inherited'><a href='#' class='side expandable'><span>&nbsp;</span></a><div class='title'><div class='meta'><a href='#!/api/Titanium.Proxy' rel='Titanium.Proxy' class='defined-in docClass'>Titanium.Proxy</a></div><a href='#!/api/Titanium.Proxy-method-addEventListener' class='name expandable'>addEventListener</a>( <span class='pre'>name, callback</span> )</div><div class='description'><div class='short'>Adds the specified callback as an event listener for the named event. ...</div><div class='long'><p>Adds the specified callback as an event listener for the named event.</p>\n\n<h3 class=\"pa\">Parameters</h3><ul><li><span class='pre'>name</span> : String<div class='sub-desc'><p>Name of the event.</p>\n\n</div></li><li><span class='pre'>callback</span> : Callback&lt;Object&gt;<div class='sub-desc'><p>Callback function to invoke when the event is fired.</p>\n\n</div></li></ul><h3 class='pa'>Returns</h3><ul><li><span class='pre'>void</span></li></ul></div></div></div><div id='method-applyProperties' class='member  inherited'><a href='#' class='side expandable'><span>&nbsp;</span></a><div class='title'><div class='meta'><a href='#!/api/Titanium.Proxy' rel='Titanium.Proxy' class='defined-in docClass'>Titanium.Proxy</a></div><a href='#!/api/Titanium.Proxy-method-applyProperties' class='name expandable'>applyProperties</a>( <span class='pre'>props</span> )</div><div class='description'><div class='short'>Applies the properties to the proxy. ...</div><div class='long'><p>Applies the properties to the proxy.</p>\n\n<p><p>Properties are supplied as a dictionary. Each key-value pair in the object is applied to the proxy such that\nmyproxy[key] = value.</p>\n\n</p><ul class='platforms'><li class='platform-android'\n        title='Android'>3.0.0</li><li class='platform-iphone'\n        title='iPhone'>3.0.0</li><li class='platform-ipad'\n        title='iPad'>3.0.0</li><li class='platform-windowsphone'\n        title='Window Phone'>4.1.0</li></ul><h3 class=\"pa\">Parameters</h3><ul><li><span class='pre'>props</span> : <a href=\"#!/api/Dictionary\" rel=\"Dictionary\" class=\"docClass\">Dictionary</a><div class='sub-desc'><p>A dictionary of properties to apply.</p>\n\n</div></li></ul><h3 class='pa'>Returns</h3><ul><li><span class='pre'>void</span></li></ul></div></div></div><div id='method-cancel' class='member  not-inherited'><a href='#' class='side expandable'><span>&nbsp;</span></a><div class='title'><div class='meta'><span class='defined-in' rel='Titanium.App.iOS.SearchQuery'>Titanium.App.iOS.SearchQuery</span></div><a href='#!/api/Titanium.App.iOS.SearchQuery-method-cancel' class='name expandable'>cancel</a>( <span class='pre'></span> )</div><div class='description'><div class='short'>Cancels a query operation. ...</div><div class='long'><p>Cancels a query operation.</p>\n\n<h3 class='pa'>Returns</h3><ul><li><span class='pre'>void</span></li></ul></div></div></div><div id='method-fireEvent' class='member  inherited'><a href='#' class='side expandable'><span>&nbsp;</span></a><div class='title'><div class='meta'><a href='#!/api/Titanium.Proxy' rel='Titanium.Proxy' class='defined-in docClass'>Titanium.Proxy</a></div><a href='#!/api/Titanium.Proxy-method-fireEvent' class='name expandable'>fireEvent</a>( <span class='pre'>name, event</span> )</div><div class='description'><div class='short'>Fires a synthesized event to any registered listeners. ...</div><div class='long'><p>Fires a synthesized event to any registered listeners.</p>\n\n<h3 class=\"pa\">Parameters</h3><ul><li><span class='pre'>name</span> : String<div class='sub-desc'><p>Name of the event.</p>\n\n</div></li><li><span class='pre'>event</span> : <a href=\"#!/api/Dictionary\" rel=\"Dictionary\" class=\"docClass\">Dictionary</a><div class='sub-desc'><p>A dictionary of keys and values to add to the <a href=\"#!/api/Titanium.Event\" rel=\"Titanium.Event\" class=\"docClass\">Titanium.Event</a> object sent to the listeners.</p>\n\n</div></li></ul><h3 class='pa'>Returns</h3><ul><li><span class='pre'>void</span></li></ul></div></div></div><div id='method-getApiName' class='member  inherited'><a href='#' class='side expandable'><span>&nbsp;</span></a><div class='title'><div class='meta'><a href='#!/api/Titanium.Proxy' rel='Titanium.Proxy' class='defined-in docClass'>Titanium.Proxy</a></div><a href='#!/api/Titanium.Proxy-method-getApiName' class='name expandable'>getApiName</a>( <span class='pre'></span> ) : String</div><div class='description'><div class='short'>Gets the value of the apiName property. ...</div><div class='long'><p>Gets the value of the <a href=\"#!/api/Titanium.Proxy-property-apiName\" rel=\"Titanium.Proxy-property-apiName\" class=\"docClass\">apiName</a> property.</p>\n\n<ul class='platforms'><li class='platform-android'\n        title='Android'>3.2.0</li><li class='platform-iphone'\n        title='iPhone'>3.2.0</li><li class='platform-ipad'\n        title='iPad'>3.2.0</li><li class='platform-windowsphone'\n        title='Window Phone'>4.1.0</li></ul><h3 class='pa'>Returns</h3><ul><li><span class='pre'>String</span><div class='sub-desc'>\n</div></li></ul></div></div></div><div id='method-getBubbleParent' class='member  inherited'><a href='#' class='side expandable'><span>&nbsp;</span></a><div class='title'><div class='meta'><a href='#!/api/Titanium.Proxy' rel='Titanium.Proxy' class='defined-in docClass'>Titanium.Proxy</a></div><a href='#!/api/Titanium.Proxy-method-getBubbleParent' class='name expandable'>getBubbleParent</a>( <span class='pre'></span> ) : Boolean</div><div class='description'><div class='short'>Gets the value of the bubbleParent property. ...</div><div class='long'><p>Gets the value of the <a href=\"#!/api/Titanium.Proxy-property-bubbleParent\" rel=\"Titanium.Proxy-property-bubbleParent\" class=\"docClass\">bubbleParent</a> property.</p>\n\n<ul class='platforms'><li class='platform-android'\n        title='Android'>3.0.0</li><li class='platform-iphone'\n        title='iPhone'>3.0.0</li><li class='platform-ipad'\n        title='iPad'>3.0.0</li><li class='platform-windowsphone'\n        title='Window Phone'>4.1.0</li></ul><h3 class='pa'>Returns</h3><ul><li><span class='pre'>Boolean</span><div class='sub-desc'>\n</div></li></ul></div></div></div><div id='method-getLifecycleContainer' class='member  inherited'><a href='#' class='side expandable'><span>&nbsp;</span></a><div class='title'><div class='meta'><a href='#!/api/Titanium.Proxy' rel='Titanium.Proxy' class='defined-in docClass'>Titanium.Proxy</a></div><a href='#!/api/Titanium.Proxy-method-getLifecycleContainer' class='name expandable'>getLifecycleContainer</a>( <span class='pre'></span> ) : <a href=\"#!/api/Titanium.UI.Window\" rel=\"Titanium.UI.Window\" class=\"docClass\">Titanium.UI.Window</a>/<a href=\"#!/api/Titanium.UI.TabGroup\" rel=\"Titanium.UI.TabGroup\" class=\"docClass\">Titanium.UI.TabGroup</a></div><div class='description'><div class='short'>Gets the value of the lifecycleContainer property. ...</div><div class='long'><p>Gets the value of the <a href=\"#!/api/Titanium.Proxy-property-lifecycleContainer\" rel=\"Titanium.Proxy-property-lifecycleContainer\" class=\"docClass\">lifecycleContainer</a> property.</p>\n\n<ul class='platforms'><li class='platform-android'\n        title='Android'>3.6.0</li><li class='platform-windowsphone'\n        title='Window Phone'>4.1.0</li></ul><h3 class='pa'>Returns</h3><ul><li><span class='pre'><a href=\"#!/api/Titanium.UI.Window\" rel=\"Titanium.UI.Window\" class=\"docClass\">Titanium.UI.Window</a>/<a href=\"#!/api/Titanium.UI.TabGroup\" rel=\"Titanium.UI.TabGroup\" class=\"docClass\">Titanium.UI.TabGroup</a></span><div class='sub-desc'>\n</div></li></ul></div></div></div><div id='method-isCancelled' class='member  not-inherited'><a href='#' class='side expandable'><span>&nbsp;</span></a><div class='title'><div class='meta'><span class='defined-in' rel='Titanium.App.iOS.SearchQuery'>Titanium.App.iOS.SearchQuery</span></div><a href='#!/api/Titanium.App.iOS.SearchQuery-method-isCancelled' class='name expandable'>isCancelled</a>( <span class='pre'></span> ) : Boolean</div><div class='description'><div class='short'>A Boolean value that indicates if the query has been cancelled (true) or not (false). ...</div><div class='long'><p>A Boolean value that indicates if the query has been cancelled (<code>true</code>) or not (<code>false</code>).</p>\n\n<h3 class='pa'>Returns</h3><ul><li><span class='pre'>Boolean</span><div class='sub-desc'><p>Returns <code>true</code> if the query was cancelled.</p>\n</div></li></ul></div></div></div><div id='method-removeEventListener' class='member  inherited'><a href='#' class='side expandable'><span>&nbsp;</span></a><div class='title'><div class='meta'><a href='#!/api/Titanium.Proxy' rel='Titanium.Proxy' class='defined-in docClass'>Titanium.Proxy</a></div><a href='#!/api/Titanium.Proxy-method-removeEventListener' class='name expandable'>removeEventListener</a>( <span class='pre'>name, callback</span> )</div><div class='description'><div class='short'>Removes the specified callback as an event listener for the named event. ...</div><div class='long'><p>Removes the specified callback as an event listener for the named event.</p>\n\n<p><p>Multiple listeners can be registered for the same event, so the\n<code>callback</code> parameter is used to determine which listener to remove.</p>\n\n\n\n\n<p>When adding a listener, you must save a reference to the callback function\nin order to remove the listener later:</p>\n\n\n\n\n<pre><code>var listener = function() { Ti.API.info(\"Event listener called.\"); }\nwindow.addEventListener('click', listener);\n</code></pre>\n\n\n\n\n<p>To remove the listener, pass in a reference to the callback function:</p>\n\n\n\n\n<pre><code>window.removeEventListener('click', listener);\n</code></pre>\n\n</p><h3 class=\"pa\">Parameters</h3><ul><li><span class='pre'>name</span> : String<div class='sub-desc'><p>Name of the event.</p>\n\n</div></li><li><span class='pre'>callback</span> : Callback&lt;Object&gt;<div class='sub-desc'><p>Callback function to remove. Must be the same function passed to <code>addEventListener</code>.</p>\n\n</div></li></ul><h3 class='pa'>Returns</h3><ul><li><span class='pre'>void</span></li></ul></div></div></div><div id='method-setBubbleParent' class='member  inherited'><a href='#' class='side expandable'><span>&nbsp;</span></a><div class='title'><div class='meta'><a href='#!/api/Titanium.Proxy' rel='Titanium.Proxy' class='defined-in docClass'>Titanium.Proxy</a></div><a href='#!/api/Titanium.Proxy-method-setBubbleParent' class='name expandable'>setBubbleParent</a>( <span class='pre'>bubbleParent</span> )</div><div class='description'><div class='short'>Sets the value of the bubbleParent property. ...</div><div class='long'><p>Sets the value of the <a href=\"#!/api/Titanium.Proxy-property-bubbleParent\" rel=\"Titanium.Proxy-property-bubbleParent\" class=\"docClass\">bubbleParent</a> property.</p>\n\n<ul class='platforms'><li class='platform-android'\n        title='Android'>3.0.0</li><li class='platform-iphone'\n        title='iPhone'>3.0.0</li><li class='platform-ipad'\n        title='iPad'>3.0.0</li><li class='platform-windowsphone'\n        title='Window Phone'>4.1.0</li></ul><h3 class=\"pa\">Parameters</h3><ul><li><span class='pre'>bubbleParent</span> : Boolean<div class='sub-desc'><p>New value for the property.</p>\n\n</div></li></ul><h3 class='pa'>Returns</h3><ul><li><span class='pre'>void</span></li></ul></div></div></div><div id='method-setLifecycleContainer' class='member  inherited'><a href='#' class='side expandable'><span>&nbsp;</span></a><div class='title'><div class='meta'><a href='#!/api/Titanium.Proxy' rel='Titanium.Proxy' class='defined-in docClass'>Titanium.Proxy</a></div><a href='#!/api/Titanium.Proxy-method-setLifecycleContainer' class='name expandable'>setLifecycleContainer</a>( <span class='pre'>lifecycleContainer</span> )</div><div class='description'><div class='short'>Sets the value of the lifecycleContainer property. ...</div><div class='long'><p>Sets the value of the <a href=\"#!/api/Titanium.Proxy-property-lifecycleContainer\" rel=\"Titanium.Proxy-property-lifecycleContainer\" class=\"docClass\">lifecycleContainer</a> property.</p>\n\n<ul class='platforms'><li class='platform-android'\n        title='Android'>3.6.0</li><li class='platform-windowsphone'\n        title='Window Phone'>4.1.0</li></ul><h3 class=\"pa\">Parameters</h3><ul><li><span class='pre'>lifecycleContainer</span> : <a href=\"#!/api/Titanium.UI.Window\" rel=\"Titanium.UI.Window\" class=\"docClass\">Titanium.UI.Window</a>/<a href=\"#!/api/Titanium.UI.TabGroup\" rel=\"Titanium.UI.TabGroup\" class=\"docClass\">Titanium.UI.TabGroup</a><div class='sub-desc'><p>New value for the property.</p>\n\n</div></li></ul><h3 class='pa'>Returns</h3><ul><li><span class='pre'>void</span></li></ul></div></div></div><div id='method-start' class='member  not-inherited'><a href='#' class='side expandable'><span>&nbsp;</span></a><div class='title'><div class='meta'><span class='defined-in' rel='Titanium.App.iOS.SearchQuery'>Titanium.App.iOS.SearchQuery</span></div><a href='#!/api/Titanium.App.iOS.SearchQuery-method-start' class='name expandable'>start</a>( <span class='pre'></span> )</div><div class='description'><div class='short'>Asynchronously queries the index for items that match the query object's specifications. ...</div><div class='long'><p>Asynchronously queries the index for items that match the query object's specifications.</p>\n\n<h3 class='pa'>Returns</h3><ul><li><span class='pre'>void</span></li></ul></div></div></div></div></div><div class='members-section'><div class='definedBy'>Defined By</div><h3 class='members-title icon-event'>Events</h3><div class='subsection'><div id='event-completed' class='member first-child not-inherited'><a href='#' class='side expandable'><span>&nbsp;</span></a><div class='title'><div class='meta'><span class='defined-in' rel='Titanium.App.iOS.SearchQuery'>Titanium.App.iOS.SearchQuery</span></div><a href='#!/api/Titanium.App.iOS.SearchQuery-event-completed' class='name expandable'>completed</a></div><div class='description'><div class='short'>Fired when the query completes to inform you about it's success. ...</div><div class='long'><p>Fired when the query completes to inform you about it's success. \nTo receive items, use the <code>founditems</code> event.</p>\n\n<h3 class=\"pa\">Properties</h3><ul><li><span class='pre'>success</span> : Boolean<div class='sub-desc'><p>Indicates if the operation succeeded. Returns true if download succeeded, false otherwise.</p>\n\n</div></li><li><span class='pre'>error</span> : String<div class='sub-desc'><p>Error message, if any returned. Undefined otherwise.</p>\n\n</div></li><li><span class='pre'>bubbles</span> : Boolean<div class='sub-desc'><p>True if the event will try to bubble up if possible.</p>\n\n<ul class=\"platforms\"><li class='platform-android' title='Android' >&nbsp;</li><li class='platform-iphone' title='iPhone' >&nbsp;</li><li class='platform-ipad' title='iPad' >&nbsp;</li></ul></div></li><li><span class='pre'>cancelBubble</span> : Boolean<div class='sub-desc'><p>Set to true to stop the event from bubbling.</p>\n\n<ul class=\"platforms\"><li class='platform-android' title='Android' >&nbsp;</li><li class='platform-iphone' title='iPhone' >&nbsp;</li><li class='platform-ipad' title='iPad' >&nbsp;</li></ul></div></li><li><span class='pre'>source</span> : Object<div class='sub-desc'><p>Source object that fired the event.</p>\n\n<ul class=\"platforms\"><li class='platform-android' title='Android' >&nbsp;</li><li class='platform-iphone' title='iPhone' >&nbsp;</li><li class='platform-ipad' title='iPad' >&nbsp;</li><li class='platform-windowsphone' title='Windows Phone' >&nbsp;</li></ul></div></li><li><span class='pre'>type</span> : String<div class='sub-desc'><p>Name of the event fired.</p>\n\n<ul class=\"platforms\"><li class='platform-android' title='Android' >&nbsp;</li><li class='platform-iphone' title='iPhone' >&nbsp;</li><li class='platform-ipad' title='iPad' >&nbsp;</li><li class='platform-windowsphone' title='Windows Phone' >&nbsp;</li></ul></div></li></ul></div></div></div><div id='event-founditems' class='member  not-inherited'><a href='#' class='side expandable'><span>&nbsp;</span></a><div class='title'><div class='meta'><span class='defined-in' rel='Titanium.App.iOS.SearchQuery'>Titanium.App.iOS.SearchQuery</span></div><a href='#!/api/Titanium.App.iOS.SearchQuery-event-founditems' class='name expandable'>founditems</a></div><div class='description'><div class='short'>Fired when the query finds a new batch of matching items. ...</div><div class='long'><p>Fired when the query finds a new batch of matching items.</p>\n\n<h3 class=\"pa\">Properties</h3><ul><li><span class='pre'>items</span> : Array&lt;<a href=\"#!/api/Titanium.App.iOS.SearchableItem\" rel=\"Titanium.App.iOS.SearchableItem\" class=\"docClass\">Titanium.App.iOS.SearchableItem</a>&gt;<div class='sub-desc'><p>An array of indexed items that match the specified query.</p>\n\n</div></li><li><span class='pre'>foundItemsCount</span> : Number<div class='sub-desc'><p>The number of items that are currently fetched.</p>\n\n</div></li><li><span class='pre'>bubbles</span> : Boolean<div class='sub-desc'><p>True if the event will try to bubble up if possible.</p>\n\n<ul class=\"platforms\"><li class='platform-android' title='Android' >&nbsp;</li><li class='platform-iphone' title='iPhone' >&nbsp;</li><li class='platform-ipad' title='iPad' >&nbsp;</li></ul></div></li><li><span class='pre'>cancelBubble</span> : Boolean<div class='sub-desc'><p>Set to true to stop the event from bubbling.</p>\n\n<ul class=\"platforms\"><li class='platform-android' title='Android' >&nbsp;</li><li class='platform-iphone' title='iPhone' >&nbsp;</li><li class='platform-ipad' title='iPad' >&nbsp;</li></ul></div></li><li><span class='pre'>source</span> : Object<div class='sub-desc'><p>Source object that fired the event.</p>\n\n<ul class=\"platforms\"><li class='platform-android' title='Android' >&nbsp;</li><li class='platform-iphone' title='iPhone' >&nbsp;</li><li class='platform-ipad' title='iPad' >&nbsp;</li><li class='platform-windowsphone' title='Windows Phone' >&nbsp;</li></ul></div></li><li><span class='pre'>type</span> : String<div class='sub-desc'><p>Name of the event fired.</p>\n\n<ul class=\"platforms\"><li class='platform-android' title='Android' >&nbsp;</li><li class='platform-iphone' title='iPhone' >&nbsp;</li><li class='platform-ipad' title='iPad' >&nbsp;</li><li class='platform-windowsphone' title='Windows Phone' >&nbsp;</li></ul></div></li></ul></div></div></div></div></div></div></div>"});